import React from 'react'

function Home() {


    const getData = async () => {
        try {
            const response = await fetch('http://localhost:9000');
            const data = await response.json();
            console.log("SUCCESS", data);
        } catch (error) {
            console.error("ERROR", error.message);    
        }
    }

    return (
        <div className='mt-5'>
            <h1>HOME PAGE</h1>
            <button onClick={getData}>FETCH DATA</button>
        </div>
    )
}

export default Home;
